This is one of my favorite easy comfort foods: a bowl of creamy cheesy vegan grits (recipe below!) with garlicky saut√©ed mushrooms and greens.  The grits are so quick to prepare and full of flavor!  I eat them at least once a week for breakfast, lunch or dinner üíö Happy weekend!
üå± vegan cheesy grits, saut√©ed garlicky mushrooms, arugula & vegan Parmesan
üíõ vegan cheesy grits:
‚Ä¢ 2 cups vegan chicken (or veggie) broth 
‚Ä¢ 2 + 1/4 cup unsweetened plant milk (I use soy)
‚Ä¢ 1 cup corn grits
‚Ä¢ 1/3 cup nutritional yeast
‚Ä¢ 1/8 tsp garlic powder
‚Ä¢ salt and pepper to taste
‚Ä¢ 2 tbsp vegan butter (can omit)
‚Ä¢ 1/2 cup shredded vegan Parmesan cheese (You can add a little extra nutritional yeast if you‚Äôd like to omit the vegan cheese.)
- In a medium saucepan, heat the broth and milk over medium heat just to a boil.
- Add the corn grits slowly, stirring with a whisk or a fork until incorporated, then reduce heat to low.
- Let simmer for 4 minutes, stirring and scraping the bottom of the pan frequently.
- Mix in the nutritional yeast, cheese, butter, garlic powder, salt and pepper.
- You can add more soy milk or broth at this point if you‚Äôd like.
